import styled from 'styled-components';

export const Profile = styled.div`
  margin-left: auto;
  margin-right: auto;
  margin-top: 40px;
  margin-bottom: 60px;
  padding: 15px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  background-color: #9eddcc7a;
  width: 230px;
  border: 1px solid black;
  border-radius: 5%;
`;
